import React, { useState } from 'react';
import { Upload } from 'lucide-react';
import backgroundImage from './images/background.png';

const App = () => {
  const [file, setFile] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [result, setResult] = useState(null);

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setFile(selectedFile);
    setResult(null);
  };

  const handleObfuscate = async () => {
    if (!file) return;

    setIsProcessing(true);
    try {
      const formData = new FormData();
      formData.append('file', file);

      const response = await fetch('http://localhost:3001/api/obfuscate', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error('Obfuscation failed');
      }

      const data = await response.json();
      setResult({
        fileName: file.name.replace(/\.[^/.]+$/, '') + '_obfuscated.js',
        content: data.obfuscatedCode
      });
    } catch (error) {
      console.error('Error during obfuscation:', error);
      alert('Failed to obfuscate file. Please try again.');
    } finally {
      setIsProcessing(false);
    }
  };

  const handleDownload = () => {
    if (!result) return;

    const blob = new Blob([result.content], { type: 'text/javascript' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = result.fileName;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  return (
    <div 
      className="min-h-screen w-full flex items-center justify-center py-8 px-4"
      style={{
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat'
      }}
    >
      <div className="w-full max-w-2xl">
        <div className="backdrop-blur-md bg-white/30 rounded-2xl shadow-2xl p-8 border border-white/20">
          <h1 className="text-3xl font-bold text-center mb-8 text-white drop-shadow-lg">
            JavaScript File Obfuscator
          </h1>
          
          <div className="space-y-6">
            <div className="border-2 border-white/30 rounded-xl p-8 text-center backdrop-blur-sm bg-white/10 hover:bg-white/20 transition-all duration-300">
              <input
                type="file"
                accept=".js"
                onChange={handleFileChange}
                className="hidden"
                id="file-upload"
              />
              <label 
                htmlFor="file-upload"
                className="cursor-pointer flex flex-col items-center"
              >
                <Upload className="w-16 h-16 text-white/80 mb-4" />
                <span className="text-lg text-white/80">
                  {file ? file.name : 'Click to upload or drag and drop'}
                </span>
              </label>
            </div>

            <div className="flex justify-center">
              <button
                onClick={handleObfuscate}
                disabled={!file || isProcessing}
                className={`px-8 py-3 rounded-lg text-white text-lg font-semibold transition-all duration-300 ${
                  !file || isProcessing
                    ? 'bg-gray-400/50 cursor-not-allowed'
                    : 'bg-blue-500/80 hover:bg-blue-600/80 hover:shadow-lg'
                }`}
              >
                {isProcessing ? 'Processing...' : 'Obfuscate'}
              </button>
            </div>

            {result && (
              <div className="mt-8">
                <div className="flex justify-between items-center mb-4">
                  <h3 className="text-xl font-semibold text-white">Result</h3>
                  <button
                    onClick={handleDownload}
                    className="px-6 py-2 bg-green-500/80 text-white rounded-lg hover:bg-green-600/80 transition-all duration-300 hover:shadow-lg"
                  >
                    Download
                  </button>
                </div>
                <pre className="bg-gray-900/90 text-gray-100 p-6 rounded-xl overflow-x-auto backdrop-blur-sm">
                  <code>{result.content.slice(0, 200)}...</code>
                </pre>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
